def cog_RPM(cogs, n): 
    total_teeth = 1
    for teeth in cogs:
        total_teeth *= teeth
    if n < 0:
        n = len(cogs) + n
    return [n * total_teeth * -1, n * total_teeth]

def cog_RPM(cogs, n): 
    rpm = cogs[0]
    for i in range(1, len(cogs)):
        rpm *= cogs[i]
    if n != 0:
        rpm /= cogs[-1]
    if rpm < 0:
        rpm = -rpm
    return [rpm, rpm]

def cog_RPM(cogs, n):
    gear_ratio = 1
    for i in range(n):
        gear_ratio *= (cogs[i] / cogs[i+1])
    first_cog_RPM = 1 / gear_ratio
    if first_cog_RPM < 0:
        first_cog_RPM = -first_cog_RPM
    last_cog_RPM = first_cog_RPM * cogs[-1] / cogs[0]
    if last_cog_RPM < 0:
        last_cog_RPM = -last_cog_RPM
    return [first_cog_RPM, last_cog_RPM]

